 @LetsShitPost  Fair enough.  I think you're right that TDD had more going on under the hood, and so the penalties for just dicking around were harsher.
I personally prefer a more guided horror experience.  Harder to lose interest, imo.
And if you just wanna have a bad time (not in a good way) you play Machine for Pigs.

 @AkiRa22084  Not really. At best it means that it fails in a fear-inducing ascpet. There is no fear bar here, and the visual presentation of fear  is a bit more subtle with structiral intent.
 Of course I understand what you mean, but there is more to horror than just fear. If you really are interested I suggest reading Chapter 4 from Carroll's Philosophy of Horror; there is a nice summary and overview of various approaches to horror.

There is more to aesthetics of a piece than just being satisfied or dissatisfied with one quality of presentation.  So: no. I don't think you can be succesful when evaluating a whole on the ground of some one aspect that enters into its form. It's like disliking a painting  because you don't like color blue. Or rather something more - evaluationg it as bad because you don't like blue.
